// ==UserScript==
// @name         软考
// @namespace    http://tampermonkey.net/
// @version      2024-06-01
// @description  替换图片
// @author       AN drew
// @match        https://www.ruankao.org.cn/guide
// @require      https://lib.baomitu.com/jquery/3.5.0/jquery.min.js
// @grant        GM_addStyle
// @downloadURL https://update.greasyfork.org/scripts/496864/%E8%BD%AF%E8%80%83.user.js
// @updateURL https://update.greasyfork.org/scripts/496864/%E8%BD%AF%E8%80%83.meta.js
// ==/UserScript==

(function() {
    'use strict';

    let list=['https://www.ruankao.org.cn/article/content/bkzn/02_16',
              'https://www.ruankao.org.cn/article/content/bkzn/02_36',
              'https://www.ruankao.org.cn/article/content/bkzn/02_55',
              'https://www.ruankao.org.cn/article/content/bkzn/02_54',
              'https://www.ruankao.org.cn/article/content/bkzn/01_38',
              'https://www.ruankao.org.cn/article/content/bkzn/01_39',
              'https://www.ruankao.org.cn/article/content/bkzn/01_59'];

    if(window.location.href=='https://www.ruankao.org.cn/guide')
    {
        GM_addStyle(`img{max-width:920px}
        .layui-tab-item:nth-of-type(1) a.del{color:#8080805c; text-decoration:line-through}
        /*.layui-tab-item:nth-of-type(1) a.del:hover{color:#0089ff!important}*/
        `);

        let timer1=setInterval(function(){
            if($('.layui-tab-item:nth-of-type(1)').length>0)
            {
                clearInterval(timer1);
                $('.layui-tab-item:nth-of-type(1) a').each(function(){
                    if(list.includes($(this).attr('href')))
                    {
                        $(this).addClass('del');
                    }
                });
            }
        },100);

        let timer2=setInterval(function(){
            if($('.layui-tab-item:nth-of-type(2)').length>0)
            {
                clearInterval(timer2);
                $('.layui-tab-item:nth-of-type(2)').empty();
                $('.layui-tab-item:nth-of-type(2)').append('<img>');
                $('.layui-tab-item:nth-of-type(2) img').attr('src',`data:image/png;base64,`);
            }
        },100);
    }
})();